export function TextMessageTagParseNotClickable(
  value: string,
) {
  let newValue = value.split("<squadtag>");
  let newComp: any[] | any = [];
  newValue.forEach((element) => {
    let msgTest = element.split("<squadtag/>");
    if (msgTest.length > 1) {
      msgTest.forEach((msg, i) => {
        if (i === 0) {
          let obj = JSON.parse(msg);
          newComp.push(
            `@${obj.name}`
          );
        } else {
          newComp.push(msg);
        }
      });
    } else {
      newComp.push(msgTest);
    }
  });

  return newComp;
}
